// ==UserScript==
// @name         SRUN3000 helper
// @namespace    Kn
// @version      1.2
// @description  自动登录srun3000校园网计费系统，关闭登录成功页面并返回跳转前页面
// @author       KevinTan
// @match        http://192.0.0.6/*
// @grant        none
// ==/UserScript==
/* jshint -W097 */
'use strict';
var defaultUrl = 'http://www.bing.com';
var sid = null;
var View = function () {
  var ret = {
  };
  var style = document.createElement('style');
  var header = document.createElement('header');
  var brand = document.createElement('div');
  var board = document.createElement('div');
  var info = document.createElement('div');
  var body = document.createElement('div');
  var form = document.createElement('div');
  style.innerHTML = '*{box-sizing:border-box} html,body{margin:0;padding:0;height:100%} header, header *{box-sizing:border-box;font-size:16px;line-height:50px;height:50px;}' +
  'input {width: 100%;display: block;margin-bottom: 20px;line-height: 30px;-webkit-appearance: none;outline: none;border: 1px solid #ddd;border-radius: 3px;padding: 2px 15px;}' +
  'input:focus {border-color: #138bca;transition: all 0.2s ease-in;}' +
  'button:hover {background: #3288b6;transition: all .1s ease-in;cursor: pointer;}' +
  'button {width: 100%;height: 40px;background: #55a9d4;border: 1px solid #55a9d4;border-radius: 3px;color: #fff;}'+
  '.body {background-repeat:repeat;background-image: url(data:image/svg+xml;base64,);}'
  header.style = 'position:fixed;background-color:#303a40;z-index:9999;top:0;left:0;width:100%;color:#fff;' +
  '-webkit-box-shadow: 0 2px 5px rgba(0,0,0,.2);-moz-box-shadow: 0 2px 5px rgba(0,0,0,.2);box-shadow: 0 2px 5px rgba(0,0,0,.2)';
  brand.style = 'float:left;background-color:#3689b3;padding:0 30px';
  board.style = 'width;100%;white-space:nowrap;overflow:hidden;text-align:center;opacity:1';
  info.style = 'float:right;color:#ccc;padding:0 20px;cursor:pointer';
  form.style = 'width: 400px;margin: 10% auto 0;background: #fff;padding:60px 20px;box-shadow: 1px 1px 2px rgba(0,0,0,0.1);min-height: 300px;';
  body.style = 'padding-top: 50px;height: 100%;min-height: 100%;background-color: #f5f5f5;';
  body.className = 'body';
  brand.innerText = 'SRUN3000认证助手';
  board.innerText = '欢迎使用 (\'v\')~';
  info.innerText = '@kevinsfork';
  ret.clear = function () {
    document.body.innerHTML = '';
  }
  ret.setHeader = function () {
    header.appendChild(brand);
    header.appendChild(info);
    header.appendChild(board);
  }
  ret.setBody = function () {
    document.body.appendChild(body);
    body.appendChild(form);
    form.innerHTML = '<input type=\'text\' id=\'username\' placeholder=\'username\'/>' +
    '<input type=\'password\' id=\'password\' placeholder=\'password\'/>' +
    '<button id=\'done\' class=\'btn-primary\'>Done</button>';
  }
  ret.print = function (msg, speed) {
    speed = speed || 0.1;
    if (speed == 1) {
      board.innerText = msg;
      return;
    }
    function fadeOut() {
      if (board.style.opacity > 0) {
        board.style.opacity = 1 * board.style.opacity - speed;
        requestAnimationFrame(fadeOut);
      } else {
        board.innerText = msg;
        requestAnimationFrame(fadeIn);
      }
    }
    function fadeIn() {
      if (board.style.opacity < 1) {
        board.style.opacity = 1 * board.style.opacity + speed;
        requestAnimationFrame(fadeIn);
      }
    }
    requestAnimationFrame(fadeOut);
  } //init

  ret.clear();
  ret.setHeader();
  ret.setBody();
  document.body.appendChild(header);
  document.head.appendChild(style);
  return ret;
}
function Lib(logInfo, print) {
  this.username = logInfo.username || '';
  this.password = logInfo.password || '';
  this.print = print || console.log.bind(console);
  if (this.username.trim() === '' || this.password.trim() === '') {
    this.handler('lack_user_info');
    return;
  }
  this.req = this.getRequestObject();
}
Lib.prototype.setUser = function (loginInfo) {
  if (!this.req) return;
  var username = logInfo.username || '';
  var password = logInfo.password || '';
  if (username.trim() !== '' && password.trim() !== '') {
    this.username = username;
    this.password = password;
  }
}
Lib.prototype.DICT = {
  'user_tab_error': '认证程序未启动',
  'username_error': '用户名错误',
  'non_auth_error': '您无须认证，可直接上网',
  'password_error': '密码错误',
  'status_error': '用户已欠费，请尽快充值。',
  'available_error': '用户已禁用',
  'ip_exist_error': '您的IP尚未下线，请等待2分钟再试。',
  'usernum_error': '用户数已达上限',
  'mode_error': '系统已禁止WEB方式登录，请使用客户端',
  'time_policy_error': '当前时段不允许连接',
  'flux_error': '您的流量已超支',
  'minutes_error': '您的时长已超支',
  'ip_error': '您的IP地址不合法',
  'mac_error': '您的MAC地址不合法',
  'sync_error': '您的资料已修改，正在等待同步，请2分钟后再试。',
  'logout_error': '您不在线上',
  //custom
  'lack_user_info': '缺少用户信息',
  'login_ssccuess': '登陆成功,跳转回原页面',
  'online_num_error': '登录人数超过限额,尝试强制注销',
  'logout_ok': '注销成功',
};
Lib.prototype.getRequestObject = function () {
  var self = this;
  var req = new XMLHttpRequest();
  req.addEventListener('load', function (e) {
    var status = req.responseText;
    return self.handler(/^\d+$/.test(status) ? 'login_ssccuess' : status);
  });
  return req;
}
Lib.prototype.login = function () {
  if (!this.req) return;
  this.print('正在使用 ' + this.username + ' 的用户信息登陆');
  this.req.open('POST', '/cgi-bin/do_login');
  this.req.send('username=' + this.username + '&password=' + hex_md5(this.password).substr(8, 16) + '&drop=0&type=1&n=1');
}
Lib.prototype.logout = function () {
  if (!this.req) return;
  this.req.open('POST', '/cgi-bin/force_logout');
  this.req.send('username=' + this.username + '&password=' + this.password + '&drop=0&type=1&n=1');
}
Lib.prototype.redirect = function () {
  var url = window.location.toString().match(/(?:url=)(https?:\/\/.*$)/);
  console.log(url);
  window.location.href = url ? url[1] || defaultUrl : defaultUrl;
}
Lib.prototype.wait = function (sec, cb) {
  var self = this;
  sid = window.setInterval(function () {
    if (sec === 0) {
      sid && window.clearInterval(sid);
      cb && cb();
    } else {
      var hint = '等待 ' + sec + 's 后自动登录';
      self.print(hint, 1);
    }
    sec--;
  }, 1000);
}
Lib.prototype.handler = function (code) {
  this.print(this.DICT[code]);
  console.log(code);
  switch (code) {
    case 'login_ssccuess':
    case 'non_auth_error':
      this.redirect();
      break;
    case 'online_num_error':
      this.logout();
      break;
    case 'logout_ok':
      this.wait(60, this.login.bind(this));
      break;
  }
} //put allthings together

if (document.title.indexOf('欢迎使用') !== - 1) {
  var view = View();
  var logInfo = {
    username: window.localStorage.username,
    rpassword: window.localStorage.password,
    password: window.localStorage.password
  }
  var lib = new Lib(logInfo, view.print);
  var btn = document.getElementById('done');
  btn.addEventListener('click', function (e) {
    console.log('hahaha');
    e.preventDefault();
    var unameIp = document.getElementById('username');
    var passwdIp = document.getElementById('password');
    if (unameIp.value && unameIp.value.trim() && passwdIp.value && passwdIp.value.trim()) {
      //save to localstorage
      localStorage.username = unameIp.value;
      localStorage.password = passwdIp.value;
      lib.setUser({username:unameIp.value, password:passwdIp.value});
      lib.login();
    } else {
      view.print('输入不能为空');
      unameIp.value = '';
      passwdIp.value = '';
    }
  });
  if (lib.req) {
    var times = 5,
    isCancelled = false;
    document.addEventListener('keydown', function (e) {
      if (e.keyCode == 27) {
        isCancelled = true;
      }
    });
    var s = window.setInterval(function () {
      if (times <= 0) {
        s && window.clearInterval(s);
        if (!isCancelled) lib.login();
      } else {
        if (isCancelled) {
          times = 0;
          view.print('自动登录已取消');
        } else {
          view.print('即将以' + logInfo.username + '账户登录(按Esc取消)...' + times + 's', 1);
        }
        times--;
      }
    }, 1000)
  }
} else if (document.title.indexOf('登录成功') !== - 1) {
  window.onbeforeunload = null;
  window.onunload = null;
  if (window.opener) {
    window.opener.close();
    window.close();
  }
}
